CREATE TABLE IF NOT EXISTS `houses` (`ID` int(11) NOT NULL AUTO_INCREMENT, `Description` VARCHAR(64), `Owner` VARCHAR(25), `EnterX` FLOAT(10), `EnterY` FLOAT(10), `EnterZ` FLOAT(10), `EnterA` FLOAT(10), `ExitX` FLOAT(10), `ExitY` FLOAT(10), `ExitZ` FLOAT(10), `ExitA` FLOAT(10), `EnterWorld` INT(4), `EnterInt` INT(4), `ExitInt` INT(4), `Owned` INT(1), `Locked` INT(1), `Price` INT(10), `Beds` INT(10), `Rooms` INT(10), `Garages` INT(10), `Rentable` INT(1), `RentCost` INT(10), `Location` VARCHAR(28), PRIMARY KEY (ID), KEY (ID)) ENGINE = InnoDB DEFAULT CHARSET = latin1 AUTO_INCREMENT = 1;

